import React, { Component } from "react";

class Toc extends Component {
  render() {
    var lists = [];
    var data = this.props.contents;
    var i = 0;
    while (i < data.length) {
      lists.push(
        <li>
          <a href={"/content/" + data[i].id}>{data[i].title}</a>
        </li>
      );
    }
    // for (let i = 0; i < data.length; i++) {}
    return (
      <nav>
        <ul>{lists}</ul>
      </nav>
    );
  }
}

export default Toc;
